import { render } from '@testing-library/react';
import React from 'react'


class EventList extends React.Component {

	// Constructor
	constructor(props) {
		super(props);

		this.state = {
			items: [],
			DataisLoaded: false
		};
	}

	// ComponentDidMount is used to
	// execute the code
	componentDidMount() {
		fetch("https://www.postman.com/collections/729672539796b9f959df")
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					items: json,
					DataisLoaded: true
				});
			})
	}

	render() {
		const { DataisLoaded, items } = this.state;
    const list = []
    const arrayinneritem = []
		if (!DataisLoaded) return <div>
			<h1> Please wait some time.... </h1> </div> ;

    items.event.forEach((arrayitem) => {
        list.push({arrayitem})
    })

    console.log(items.event[0].arrayitem.listen)
	//console.log(list)

	let eventItems = [];
	for(var i=0;i<items.event.length;i++)
	{ 
		eventItems.push(<div className="card">
			<div className="card-body">
				<h5 className="card-title">{list[i].arrayitem.listen}</h5>
				<button type="button" className="btn btn-primary">Book</button>
			</div>
		</div>
	  );
	}


		return (
			<div className = "App">
				{ eventItems }
			</div>
		);
	}
}

export default EventList
